import axios from "axios";
import React from "react";
import { useEffect } from "react";
import { useState } from "react";
import { useSelector } from "react-redux";
import { Table } from "antd";

export default function VolunteerEntregas() {
  const [entregas, setEntregas] = useState([]);
  const user = useSelector((state) => state.user);

  useEffect(() => {
    axios
      .get(`/api/entregas/user/${user.id}`)
      .then((res) => res.data)
      .then((entregas) => setEntregas(entregas));
  }, []);

  const dataSource = [];

  const columns = [
    {
      title: "Bloque",
      dataIndex: "bloque",
      key: "bloque",
    },
    {
      title: "Contenido",
      dataIndex: "contenido",
      key: "contenido",
    },
    {
      title: "Estado",
      dataIndex: "estado",
      key: "bloque",
    },
  ];

  return (
    <div>
      {console.log("ENTREGAS", entregas)}
      <h1>Mis entregas</h1>
      <table>
        <tr>
          <th>Bloque</th>
          <th>Contenido</th>
          <th>Estado</th>
        </tr>
        {entregas.length &&
          entregas.map((entrega) => {
            return (
              <tr>
                <td>{entrega.bloque.titulo}</td>
                <td>{entrega.contenido}</td>
                <td>{entrega.aprobado ? "Aprobada" : "Pendiente"}</td>
              </tr>
            );
          })}
      </table>
    </div>
  );
}
